[[Pickpocketing]] [[master farmer]]s can yield good amounts of [[seeds]] for [[Farming]]. The real money-makers are [[Ranarr seed]]s, [[Snapdragon seed]]s, and [[Snape grass seed]]s (worth {{Coins|{{GEP|Ranarr seed}}}}, {{Coins|{{GEP|Snapdragon seed}}}}, and {{Coins|{{GEP|Snape grass seed}}}}, respectively). These seeds are very rare (appearing every 1/302, 1/2083, and 1/260 pickpockets, respectively) but make up {{#expr:
100*(0.048*.069*{{GEP|Ranarr seed}} + 0.048*.010*{{GEP|Snapdragon seed}} + 0.485*.010*{{GEP|Snape grass seed}})/{{#var:PRICEonepick}} round 1}}% of the profit.

It's not recommended to pickpocket [[Martin the Master Gardener|Martin]] in [[Draynor]], due to the left click talk option.

If low on health, players can buy wines from [[Fortunato]] in [[Draynor Village]], or steal some cake from the [[Baker]]'s stall if pickpocketing in [[Ardougne]]. Otherwise, players will need to use conventional [[food]] to restore [[Hitpoints]].

With {{SCP|Farming|85}} a player can access the north wing of the Farming Guild wherein a Master Farmer can be trapped within the three-tile area on the west side of the Celastrus tree patch. Once the farmer walks to the furthest southern tile, a player only has to move one tile north every four minutes or so to allow the Master Farmer to move and reset its 5-minute respawn timer. Avoid stepping on the black rabbit or another player as this will cause the farmer to no longer be trapped by your character.

Profit varies enormously based off thieving level, greatly improving after certain milestones. At {{SCP|Thieving|50}} players can equip full [[Rogue equipment]] for guaranteed double loot, doubling profit. At {{SCP|Thieving|72}} players can complete the [[Ardougne Diary|Ardougne Diary (hard)]] for an additional 10% pickpocketing boost. It is not recommended to thieve Master farmers for profit at low levels as there are much better money making methods out there. Below are some experience and profit estimates at certain levels.
